import React from "react";
import { Button } from "primereact/button";

interface BtnStoreCancelProps {
  createUpdate: () => boolean; 
  onAbbruch: () => void;
}

export function BtnStoreCancel({ createUpdate, onAbbruch }: BtnStoreCancelProps) {
  return (
    <>
      <Button
        label="Speichern"
        className="p-button-outlined p-button-success m-2"
        onClick={createUpdate}
      />
      <Button
        label="Abbruch"
        className="p-button-outlined m-2 ml-6"
        onClick={onAbbruch}
      />
    </>
  );
}
